        public Int32 Get(String Group, String Category, String Name)
        {
            Int32 i = 0;
            try
            {
                while (i < Voices.Count && (Voices[i][0] != Group || Voices[i][1] != Category || Voices[i][3] != Name)) i++;
                if (i >= Voices.Count)
                {
                    i = -1;
                }
            }
            catch
            {
                i = -1;
            }
            return i;
        }
    }
